(10, 0, 1586387012, '151.106.11.187', '151.106.11.187', 'Yahoo Finance', 'finance@yahoo.com', 'BitHull S.A. is pleased to announce the launch of its two new crypto miners BH Miner and BH Miners Box. These miners have been built around Field Programmable Gate Array or FPGA mining technology, the latest breakthrough in crypto mining. FPGA mining makes use of the new generation of FPGA chips capable of delivering high hash rate power at low power consumption. Owing to its outstanding features, FPGA mining is expected to overtake ASIC mining very soon. \r\n \r\nBH Miner and BH Miners Box are multi-algorithm miners capable of mining bitcoin, litecoin, ethereum, and monero. BH Miners Box is a box combining 6 BH Miner units connected to each other. Mentioned below are the key features of the two miners. \r\n \r\nBH Miner Hash Rates: Bitcoin: 360 TH/s, Litecoin: 60 GH/s, Ethereum: 15 GH/s, and Monero: 3 MH/s \r\n \r\nBH Miners Box: Bitcoin: 2160 TH/s, Litecoin: 360 GH/s, Ethereum: 90 GH/s, and Monero: 18 MH/s \r\n \r\nPower consumption: 550W and 550W x6 for BH Miner and BH Miners Box respectively \r\n \r\nRead more .. \r\nhttps://finance.yahoo.com/news/bithull-overtakes-asic-market-fpga-173800650.html'),
(11, 0, 1588788213, '84.17.51.39', 'unn-84-17-51-39.cdn77.com', 'Raymond 	Brown', 'info@thecctvhub.com', 'Dear Sir/mdm, \r\n \r\nHow are you? \r\n \r\nWe supply medical products: \r\n \r\nMedical masks \r\n3M 1860, 9502, 9501, 3ply, KN95, KN99, N95 masks \r\nProtective masks \r\nEye mask \r\nProtective cap \r\nDisinfectant \r\nHand sanitiser \r\nMedical alcohol \r\nEye protection \r\nDisposable latex gloves \r\nProtective suit \r\nIR non-contact thermometers \r\nHuman body thermal cameras \r\n \r\nfor Body Temperature Measurement up to accuracy of ±0.1?C \r\nAdvantages of thermal imaging detection: \r\n \r\n1. Intuitive, efficient and convenient, making users directly \"see\" the temperature variation. \r\n2. Thermal condition of different locations for comprehensive analysis, providing more information for judgment \r\n3. Avoiding judgment errors, reducing labor costs, and discovering poor heat dissipation and hidden trouble points \r\n4. PC software for data analysis and report output \r\n \r\nWhatsapp: +65 87695655 \r\nTelegram: cctv_hub \r\nSkype: cctvhub \r\nEmail: sales@thecctvhub.com \r\nW: http://www.thecctvhub.com/ \r\n \r\nIf you do not wish to receive email from us again, please let us know by replying. \r\n \r\nregards, \r\nRaymond'),
(12, 0, 1589545177, '84.17.51.34', 'unn-84-17-51-34.cdn77.com', 'YOZAWA KEN', 'avatoniebtea@rediffmail.com', 'Did yоu knоw thаt it is pоssiblе tо sеnd businеss оffеr аbsоlutеly lеgаl? \r\nWе tеndеr а nеw lеgаl mеthоd оf sеnding rеquеst thrоugh соntасt fоrms. Suсh fоrms аrе lосаtеd оn mаny sitеs. \r\nWhеn suсh соmmеrсiаl оffеrs аrе sеnt, nо pеrsоnаl dаtа is usеd, аnd mеssаgеs аrе sеnt tо fоrms spесifiсаlly dеsignеd tо rесеivе mеssаgеs аnd аppеаls. \r\nаlsо, mеssаgеs sеnt thrоugh соmmuniсаtiоn Fоrms dо nоt gеt intо spаm bесаusе suсh mеssаgеs аrе соnsidеrеd impоrtаnt. \r\nWе оffеr yоu tо tеst оur sеrviсе fоr frее. Wе will sеnd up tо 50,000 mеssаgеs fоr yоu. \r\nThе соst оf sеnding оnе milliоn mеssаgеs is 90 USD. \r\n \r\nThis mеssаgе is сrеаtеd аutоmаtiсаlly. Plеаsе usе thе соntасt dеtаils bеlоw tо соntасt us. \r\n \r\n \r\nhttp://1-0x.com/2020tokyo/'),
