(15, 0, 1590043477, '37.120.156.19', '37.120.156.19', 'MelvinBok', 'atrixxtrix@gmail.com', 'Dear Sir/mdm, \r\n \r\nHow are you? \r\n \r\nWe supply medical products: \r\n \r\nMedical masks \r\n3M 1860, 9502, 9501 \r\n3ply medical, KN95 FFP2, FFP3, N95 masks \r\nFace shield \r\nDisposable nitrile/latex gloves \r\nIsolation/surgical gown \r\nProtective PPE/Overalls \r\nIR non-contact thermometers \r\nCrystal tomato \r\n \r\nHuman body thermal cameras \r\nfor Body Temperature Measurement up to accuracy of ±0.1?C \r\n \r\nWhatsapp: +65 87695655 \r\nTelegram: cctv_hub \r\nSkype: cctvhub \r\nEmail: sales@thecctvhub.com \r\nW: http://www.thecctvhub.com/ \r\n \r\nIf you do not wish to receive email from us again, please let us know by replying. \r\n \r\nregards, \r\nCCTV HUB'),
(16, 0, 1590344123, '185.232.21.117', 'no-mans-land.m247.com', 'Michaelkat', 'colbrctr@gmail.com', 'Dear Sir / Madam \r\nCollaboration.center is the first FREE platform in the United Kingdom, which is offering free direct contact with major UK retailers for the manufacturers, suppliers, and wholesalers. \r\nIf you are thinking to sell your products within the United Kingdom or even expand your sales and find new retailers who are well known in the country, then our free internet platform www.collaboration.center is the perfect place for you to start. \r\nThere is no registration so you won\'t receive any unwanted mail just direct reply from retailers you select. \r\nTake your chance and use it straight away while it\'s free ( limited time only ) \r\n \r\nCollaboration Center Team \r\nhttps://collaboration.center \r\n \r\nEmail: hello@collaboration.center'),
(17, 0, 1591019812, '84.17.47.109', 'unn-84-17-47-109.cdn77.com', 'Alaa Hameed', 'aconsultas55@aol.com', 'Greetings, \r\n \r\nWe are brokers linked with high profile investors from the Gulf Region who are willing to; \r\n \r\nFund any company in any current project; \r\nFund a project/Investment of any Interest or choices; \r\n \r\nThey are privately seeking means of expanding their investment portfolio. Should you find interested in engaging us for more detailed discussion to forge ahead, We will be happy to share more insights. \r\n \r\nYours Sincerely \r\nAlaa Hameed \r\nFinancial Broker \r\nMobile/WhatsApp# +44 7537 183205'),
