(20, 0, 1591498804, '190.2.149.26', 'customer.worldstream.nl', 'Prince Taylor', 'prance.gold.arbitrage@gmail.com', 'Hi! \r\nI\'m Prince Taylor. \r\n \r\nI contacted you with an invitation for investment program witch you will definitely win. \r\n \r\nThe winning project I\'m here to invite you is called \"Prance Gold Arbitrage (PGA)\". \r\n \r\nPGA is a proprietary system that creates profits between cryptocurrency exchanges through an automated trading program. \r\n \r\nThe absolute winning mechanism \"PGA\" gave everyone the opportunity to invest in there systems for a limited time. \r\n \r\nYou have chance to join from only $ 1000 and your assets grow with automated transactions every day! \r\n \r\nInvestors who participated in this program are doubling their assets in just a few months. \r\nBelieve or not is your choice. \r\nBut don\'t miss it, because it\'s your last chance. \r\nSign up for free now! \r\n \r\nRegister Invitation code \r\nhttps://portal.prancegoldholdings.com/signup?ref=prince \r\n \r\nAbout us \r\nhttps://www.dropbox.com/s/0h2sjrmk7brhzce/PGA_EN_cmp.pdf?dl=0 \r\n \r\nPGA Plans \r\nhttps://www.dropbox.com/s/lmwgolvjdde3g8n/plans_en_cmp.pdf?dl=0 \r\n \r\nMovie \r\nhttps://www.youtube.com/watch?v=9054gGRtjX8'),
(21, 0, 1591512236, '84.17.51.98', 'unn-84-17-51-98.cdn77.com', 'CharlesSkale', 'mazitrpzn@rambler.ua', 'Dear Colleagues \r\n \r\nWe are located in the United Kingdom, and trading under the famous supermarket chain name Sainsbury\'s Supermarkets Limited. It is UK\'s one of the largest multi-channel retailer with over 1423 shops furnished by European products. As you already aware the UK is on lockdown due to coronavirus and we urgently looking for new suppliers with any kind of products currently you keeping in stock. We are looking for all kind of products to attract new customers and also retained our existing ones, as long as you have them in stock for immediate shipping. \r\n \r\nPlease send us your catalogue or your website through email to speed up the process and treat this email as urgent. We hope to be able to order with you and start a long-term friendly, respectable and solid business partnership. \r\n \r\nWe count on the reliability of both sides. We commit ourselves for successful and professional processing for good cooperation in all ranges. \r\n \r\nPlease, keep in mind that we are only interested in the products you currently have in stock. \r\n \r\nWe would appreciate if you could send us your stock availability via email: suppliers@sainsburyplcs.com \r\n \r\nWe will also be pleased to receive any offers or proposals from other products available and ready (Stocks and rates). \r\n \r\nTarget: Our Payment Term is swift within 30 days net in Europe and 15 days NET in UK  as we operate with all our suppliers. \r\n \r\nSainsbury\'s Supermarkets Limited \r\nPurchasing Department \r\n \r\n33 Holborn \r\nLondon \r\nUnited Kingdom \r\nEC1N 2HT \r\n \r\n \r\nEmail: suppliers@sainsburyplcs.com \r\n \r\nHelpline: +442081266699  (+44 208 126 6699 or 020 8126 6699)'),
(22, 0, 1592377102, '139.28.217.200', '139.28.217.200', 'JuliaCrolo', 'f5julia@yahoo.com', 'Greetings, \r\nHope you are well. \r\n \r\nI am Julia from F5 Studio. I was going through your website & I personally see a lot of potential in your website & business. We can help you significantly improve your existing website by not just enhancing its design but also by making it user friendly for your customers. \r\n \r\nDoes that sound interesting? \r\n \r\nOur public profiles: \r\nhttps://clutch.co/profile/f5-studio \r\nhttps://www.behance.net/F5STUDIO \r\n \r\nPlease email us back to get more info. \r\nKind Regards \r\nJulia \r\nF5-studio.com'),
(23, 0, 1592959529, '84.17.47.41', 'unn-84-17-47-41.cdn77.com', 'John Brooks', 'swetmangdudley@gmail.com', 'My name is John Brooks of AAA Structured Finance Ltd , Thank you for your time, my company offers project financing and lending services, do you have any project that requires funding at the moment? We are ready to work with you on a more transparent approach. \r\n \r\nBest regards, \r\nJohn Brooks \r\nPrincipal Partner \r\nAAA Structured Finance Ltd \r\nE-mail: brooksjohn801@gmail.com'),
