(25, 0, 1593169621, '89.187.168.160', 'unn-89-187-168-160.cdn77.com', 'KomalJadly', 'no-replyDiuck@gmail.com', 'Greetings, I reached to your website while searching for something on internet. But I am writing as I was wondering about the payment method currently offered by you to your customers while having such great website? \r\n \r\n \r\nI work for https://amald.com/ and we can offer credit card and various local payment methods (eNets, Net Banking, Alipay, CUP, SEPA, SOFORT..etc) to accept online payments on your websites. \r\n \r\nOur pricing start with 1.5% for Local Payments and 2.5% for \r\ncredit card payments, Which typically economic from other competitor. \r\n \r\nEmail me  on info@amald.com; I will send you further information and joining process. \r\n \r\n \r\nRegards, \r\nKomal'),
(26, 0, 1593731130, '84.17.48.243', 'unn-84-17-48-243.cdn77.com', 'HeatherDiuch', 'atrixxtrix@gmail.com', 'Dear Sir/mdm, \r\n \r\nHow are you? \r\n \r\nWe supply Professional surveillance & medical products: \r\n \r\nMedical masks \r\nMoldex, makrite and 3M N95 1860, 9502, 9501, 8210 \r\n3ply medical, KN95, FFP2, FFP3, PPDS masks \r\nFace shield \r\nNitrile/vinyl/PP gloves \r\nIsolation/surgical gown lvl1-4 \r\nProtective PPE/Overalls lvl1-4 \r\nIR non-contact thermometers/oral thermometers \r\nsanitizer dispenser \r\nCrystal tomato \r\n \r\nMarine underwater CCTV \r\nExplosionproof CCTV \r\n4G Solar CCTV \r\nHuman body thermal cameras \r\nfor Body Temperature Measurement up to accuracy of ±0.1?C \r\n \r\nWhatsapp: +65 87695655 \r\nTelegram: cctv_hub \r\nSkype: cctvhub \r\nEmail: sales@thecctvhub.com \r\nW: http://www.thecctvhub.com/ \r\n \r\nIf you do not wish to receive email from us again, please let us know by replying. \r\n \r\nregards, \r\nCCTV HUB'),
(27, 0, 1594392623, '78.159.113.196', '78.159.113.196', 'David Floyd', 'tinalim.ldliebal@hotmail.com', 'Good Day, \r\n \r\nI am  David Floyd in charge of purchase and sales in D & D Industries. \r\nWe are interested in doing a business with your company. \r\nOur client is in need of your product please get back to me with your business terms.So i can place my demand. \r\n \r\nYour early reply is highly appreciated. Contact us through E-mail:   sales@danddindustrustires.com \r\n \r\nBest regards \r\n \r\nDavid Floyd \r\nD & D Industries, Inc \r\nE-mail: sales@danddindustrustires.com'),
(28, 0, 1595442538, '82.102.16.198', '82.102.16.198', 'Barbara Waclaw', 'house@choose2help.org', 'This year began for us with a total disaster. Our house was burned down and we literally lost everything. We wish for nothing more but to be able to live back in a place where we have spent the last 50 years together. \r\nWe are with a verified charity: \r\nhttps://choose2help.org/lets-help-rebuild-the-house.html \r\nThank you for your support. Barbara.');
INSERT INTO `homepage` (`id`, `date`, `text`, `title`, `signed`, `file`, `active`) VALUES
(66, 1568224502, 'Zaczynamy 1 stycznia 2020r.', 'Już wkrótce START!', 'Zespół photolio.pl', 1, 1),
(15, 1565231489, 'Photolio.pl Jest serwisem, który umożliwia swoim użytkownikom zaprezentowanie się w świecie fotografii poprzez całkowicie darmowe udostępnienie przestrzeni na własne portfolio fotograficzne.\r\nZałożenia serwisu są proste: \r\nJesteś fotografem? Nie ważne czy profesjonalistą działającym na rynku od wielu lat, czy też dopiero raczkujesz w fotografii. Każdy znajdzie tu kawałek przestrzeni na zaprezentowanie swoich prac.', 'Kim jesteśmy?', 'Zespół photolio.pl', 1, 1),
(71, 1577443582, 'Z okazji zbliżającego się Sylwestra chcielibyśmy Wam życzyć szampańskiej i niezapomnianej zabawy, a w nadchodzącym 2020 roku życzymy Wam aby spełniały się marzenia - te małe, o których wstydzimy się mówić głośno i te wielkie, które być może teraz wydają się niemożliwe.\r\nŻyczymy także spełnienia w życiu zawodowym, realizacji planów i wspinania się po drabince kariery. A w życiu rodzinnym spokoju i bezpieczeństwa.', 'Życzenia pomyślności w nowym roku.', 'Zespół photolio.pl', 1, 1),
(75, 1578586789, 'Właśnie udostępniliśmy narzędzie, które umożliwia dodawanie większej ilości zdjęć za jednym razem. Wystarczy wejść w nową zakładkę <strong>upload</strong> .\r\nMamy nadzieję, że nowe narzędzie ułatwi pracę przy tworzeniu galerii.\r\n', 'Już nie musisz dodawać zdjęć pojedynczo.', 'Zespół photolio.pl', 1, 1),
(88, 1579018353, 'Właśnie przed chwilą wprowadziliśmy zmiany umożliwiające personalizację zakładek głównego manu na Waszych stronach. \r\nOd teraz możliwe jest włączanie lub wyłączanie poszczególnych zakładek oraz istnieje możliwość ustawienia strony bloga lub galerii jako strony startowej.\r\nPonadto zakładkom można nadawać swoje własne nazwy.', 'Nowość! - edycja zakładek Twojej strony.', 'Zespół photolio.pl', 1, 1),
(89, 1579614107, 'Dotychczas, wszystkie dodawane zdjęcia musiały być aktywowane po dodaniu, aby mogły wyświetlać się w galerii. \r\nTeraz dajemy Wam możliwość automatycznego aktywowania zdjęć natychmiast po dodaniu. Wystarczy zalogować się na swoje konto, następnie przejść do zakładki ustawienia i po przewinięciu w dół ukaże się opcja <strong>Automatyczna aktywacja zdjęć</strong>. Po jej zaznaczeniu, nie będziemy musieli aktywować każdego dodawanego zdjęcia pojedynczo. Jednak będzie możliwość wyłączenia tej opcji dla każdego zdjęcia osobno. Od teraz możliwe jest również wyłącznie automatycznej aktywacji zdjęć przy multiuploadzie.', 'Automatyczna aktywacja dodawanych zdjęć', 'Zespół photolio.pl', 1, 1);
