(1, 'photolio.pl', 0, 6, 2, 0, 1, 30, '<h1>Witaj w photolio.pl! <a href=\"rejestracja\"><button type=\"button\" class=\"form\" style=\"position: relative; bottom: 5px;\">Zarejestruj konto</button></a> i twórz z nami swoje portfolio fotograficzne.', '', 'https://www.facebook.com/Photoliopl-103541334515274/', '', '', 'Jeśli potrzebujesz skontaktować się z nami w sprawie swojego konta, działania strony lub może nie znalazłeś odpowiedzi na swoje pytanie w dziale pomocy czy też masz jakiekolwiek inne pytanie, możesz wysłać nam wiadomość za pomocą poniższego formularza.', 'Dziękujemy. Twoja wiadomość została pomyślnie wysłana.');
