(2, 41, 'MARCIN BAZYLAK', 'Hello!\r\n\r\nWelcome to my website. My name is Marcin Bazylak and I am an amateur photographer. My favorite type of photography is  landscape. In addition, I really like to take portraits and I think it\'s what I\'m pretty good at.\r\nHow did it all start?\r\nMy first camera a long time ago was used Zenit E bought in the local pawn shop. I quickly noticed that taking pictures gives me a lot of satisfaction. After some time, I started taking my camera literally everywhere. I took dozens of photos and spent all my money developing them.\r\nTimes changed and equipment changed. I exchanged my Zenit for a newer model - Zenit ET. There was also Zenit 12XP, which I still have to this day. Then there was Minolta Dynax 505Si, Minolta Dynax 60 and finally my first digital SLR Konica-Minolta Dynax 5D. After a few years, I switched to Nikon. There was the Nikon D90 and then the D300s with a fairly large collection of lenses, speedlights and accessories. Today I photograph with the Nikon Z6 and I am very happy with it.\r\n\r\nMost of my attention is absorbed by landscape photography, which is very difficult and requires a lot of patience and strong will. Especially when it comes to getting up early :)', 'Cześć !!!\r\n\r\nWitaj na mojej stronie. Nazywam się Marcin Bazylak i jestm amatorem fotografii. Moim ulubionym rodzajem fotografii jest fotografia portretowa, moim ulubionym modelem, mój syn Nikodem. oprócz tego bardzo lubię robić krajobrazy.\r\nJak się to wszystko zaczęło?\r\nMoim pierwszym aparatem dawno dawno temu był używany Zenit E kupiony w miejscowym komisie. Szybko zauważyłem, że robienie zdjęć sprawia mi wiele przyjemności. Po jakimś czasie zacżąłem zabierać swój aparat dosłownie wszędzie. Robiłem dziesiątki zdjęć i wydawałem wszystkie swoje pieniądze na ich wywoływanie. \r\nCzasy się zmieniały i zmieniał się sprzęt. Swojego Zenita zamieniłem na nowszy model - Zenit ET. Był również Zenit 12XP, który z resztą mam do dziś. Później była Minolta Dynax 505Si, Minolta Dynax 60 i wreszcie pierwsza cyfrowa lustrzanka Konica-Minolta Dynax 5D. Po kilku latach nastąpiła zmiana systemu na Nikon. Był Nikon D90 i potem D300s z całkiem pokaźną kolekcją obiektywów, lamp błyskowych i akcesoriów. Dziś fotografuję Nikonem Z6 i jestem z niego bardzo zadowolony.\r\n\r\nNajwięcej mojej uwagi pochłania fotografia krajobrazowa, która jest bardzo trudna i wymaga wiele samozaparcia. Szczególnie jeśli chodzi o wczesne wstawanie :)'),
