(27, 41, 1574368492, '37.120.142.165', '37.120.142.165', 'JamesHeify', 'himrshawn@gmail.com', 'Could a 150% profit on the Microsoft/Windows products boost your business?  Great news! Windows OEMSW is offering you an excellent opportunity to pay less and earn more! \r\n \r\nWho we are? \r\nWe are a licensed wholesaler for Microsoft office and Windows products stocking an array of quality Microsoft OEM systems and Office products at the lowest prices.  From Windows 7 to Windows 10 and Office 2016 to Office 2019. we have it! \r\n \r\nWhy Choose Us? \r\nAside from offering you the lowest prices on the market, you can shop with confidence knowing that we are: \r\n•	Microsoft Authorized Gold Partner \r\n•	Up to 60% savings \r\n•	Offer Lifetime aftersales \r\n•	Fully customizable products such as: Custom software language, Custom DVD custom COA Stickers \r\n \r\n****Special offer \r\nOrder by November 21 and get a 10% discount. \r\n \r\n*****This is our best product \r\nhttps://docs.google.com/spreadsheets/d/1GKROMx_ZpH4ApH-C3AraoYVHcIYj8w03Sj64ntN0wPo \r\n \r\n \r\nNext Steps \r\nStop overpaying for your Microsoft and Windows products! Request a quote today at windowsoemsw@gmail.com or via WhatsApp. \r\n \r\nNote: Please contact us via this email: windowsoemsw@gmail.com \r\n \r\nWhatsApp:+17074128288 \r\nTelegram: kowindows \r\nE:Windowsoemsw@gmail.com \r\nW :https://windowsoemsw.com/'),
(24, 41, 1571061496, '89.228.48.227', 'host-89-228-48-227.dynamic.mm.pl', 'Marcin Bazylak', 'mbazylak79@gmail.com', 'Unstad. Wioskę Unstad, na wyspie Vestvågøy, otaczają z trzech stron góry, a duża zatoka ma unikalne położenie, nieustannie wiejący tu wiatr tworzy fale zarówno dla profesjonalnych jak i dla początkujących surferόw. Ogromna plaża jest idealnym miejscem na odpoczynek. Maleńkie Unstad odcięte było od świata aż do 1987 roku, kiedy to w skale wydrążono tunel, który stał się bramą wjazdową do osady. Młode przedsiębiorcze pokolenie wyspiarzy z dziećmi, postanowiło wykorzystać atuty tego miejsca i dziś oferuje wraz z przyjaciółmi i sympatykami surfingu z całej Skandynawii kursy surfingu.\r\nPlaża w Vik/ Haukland. Lazurowa woda i zdumiewająco białe plaże – to idealne miejsce na relaks oraz spacer podczas którego obserwować można Midnight Sun. Ulubiona miejscówka lokalnych, coraz częściej odkrywana i doceniana również przez odwiedzających turystów. Nierzadkim widokiem są tu również orły, które wysoko w skałach mają swoje gniazda.\r\nPlaża w Ramberg. Malownicze miejsce z lazurową wodą i piaskiem tak białym, że zawstydza on niektóre karaibskie wyspy.\r\nPlaża w Eggum. To chyba najpiękniejsze miejsce do fotografowania zachodu słońca na Lofotach.\r\nMuzeum Wikingów w Borg. Przed tysiącem lat dokładnie w tym miejscu znajdowała się jedna z największych posiadłości wikingów. Pozostałości odkryto ponad 20 lat temu i zrekonstruowano zachowując oryginalną konstrukcję oraz odkryte przez archeologów znaleziska. To tu interaktywnie poznamy jak wyglądało kiedyś życie wikingów.\r\nWioska Å. Å to ostatnia osada na drodze krajowej E10 biegnącej przez całe Lofoty. Urok tego miejsca powoduje, że zarówno turyści jak i wędkarze pragną tu wracać każdego roku. Większość budynków została zbudowana dwa stulecia temu, a ich oryginalny wygląd możemy podziwiać po dziś. W osadzie znajduje się wszystko to, co było elementem niezbędnym, aby można tu było przetrwać surowe warunki w trakcie corocznych połowów dorsza. Jest sklep, nadal czynna piekarnia z oryginalnym piecem, oferująca tradycyjnie wypieki, restauracja z pubem, najstarsza traniarnia na świecie, ogromny dom właściciela ziemskiego oraz duża liczba domków rybackich na palach zwanych – rorbuer.\r\nPołów ryb – Możliwość wykupienia opcjonalnej, morskiej wyprawy kutrem po okolicznych fiordach z połowem ryb. Cena: 550 NOK/os');
