(2, 41, 'marcinbazylak', 'Marcin Bazylak', 'http://photolio.pl/marcinbazylak', 'marcin@marcinbazylak.com', 0, 'Blog', 1, 'Portfolio', 1, 'O mnie', 1, 'Napisz do mnie', 0, 1, 0, 1, 'Moim pierwszym aparatem dawno dawno temu był używany Zenit E kupiony w miejscowym komisie. Szybko zauważyłem, że robienie zdjęć sprawia mi wiele przyjemności. Po jakimś czasie zacząłem zabierać swój aparat dosłownie wszędzie. Robiłem dziesiątki zdjęć i wydawałem wszystkie swoje pieniądze na ich wywoływanie.', 0, 0, 0, 1, 'galeria', 72, 'pl', '', 'https://www.facebook.com/BazylakMarcin', '', '', 'If you want to find out more about me or my images, use an image or just contact me to chat about photography then please leave me a message below.', 'Jeśli masz ochotę dowiedzieć się czegoś więcej na temat moich zdjęć, chcesz użyć któregoś z nich lub chcesz porozmawiać ze mną o fotografii, nie wahaj się do mnie napisać. Możesz zostawić mi wiadomość korzystając z poniższego formularza, a ja postaram się do Ciebie jak najszybciej odpisać.', 'Thank you for taking time to write to me. It means to me a lot.<br><br>\r\nYour message will be soon delivered to my mailbox and I will have the pleasure to read it. I will surely reply to your message as soon as possible.<br>\r\nIf you have any other thoughts, please do not hasitate to write to me again.', 'Dziękuję za zainteresowanie moją stroną oraz za napisanie do mnie. Postaram się odpowiedzieć na Twoją wiadomość najszybciej jak to tylko możliwe.', '333333', '111111'),
